import React, { Component } from 'react';
import Nav from './components/Nav'
import NotFound from './components/NotFound'
import Photo from './Photo'
import SearchForm from './SearchForm'
import './index.css';

import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';

import apiKey from './config'

class App extends Component {

  constructor() {
    super();
    this.state = {
      photos: []
    };
  }

  componentDidMount() {
      fetch('https://www.flickr.com/services/rest/?method=flickr.photos.search&api_key=1f8da2e2e56688eb397b68debe319f86&tags=waterfalls&per_page=24&format=json&nojsoncallback=1')
      .then(response => response.json())
      .then(responseData => {
        this.setState({ photos: responseData.data})
      })
      .catch(error => {
        console.log('Error fetching and parsing data', error)

      })
  }

  render() {
    return (
      console.log(this.state.photos),

    <BrowserRouter>
      <div class="container">

        <Switch>
          <Route path="/search" component={SearchForm}/>
          <Nav />
            <div class="photo-container">
              <h2>Results</h2>
                <Route path="/:topic" component={Photo} />
                <Route component={NotFound}/>
            </div>
          </Switch>
        </div>
        </BrowserRouter>
  );
}
}

export default App;
